import './App.css';
import React from 'react'
// import VideoCanvas from './VideoCanvas';
import MyComponent from './MyComponent'
import DetectCanvas from './DetectCanvas';
import Example from './example';

import { OpenCvProvider, useOpenCv } from 'opencv-react'


function LoadOpenCv() {
  const { loaded, cv } = useOpenCv()

  useEffect(() => {
    if (cv) {
      console.log(loaded);
    }
  }, [cv])

  return (<noscript>Test opencvjs.</noscript>)
  // return <p>OpenCv React test</p>
}

const App = () => {

  const onLoaded = (cv) => {
    console.log('opencv loaded, cv', cv)
  }

  return (
    <div>
    <OpenCvProvider onLoad={onLoaded} openCvPath='./opencv/opencv.js'>
      <LoadOpenCv />
      <MyComponent />
      <Example />
      {/*<VideoCanvas />
      <DetectCanvas /> */}
    </OpenCvProvider>
    </div>
  )
}

export default App;
